/**
* @author
* @function Education
**/

const Education = (props) => {
  return(
    <section className="Ehme">
        <div className="Eside"><Sidebar>Education Sidebar</Sidebar></div>
        <div className="Emain"><Mainpage>Education</Mainpage></div>
        <div className="Emain-2"><Mainpage>Education</Mainpage></div>
        <div className="Eside-2"><Sidebar>Education Sidebar</Sidebar></div>
    </section>
   )

 }

export default Education
